import React from "react";
import "../component/todos.css";
import { List, Card, CardContent, ListItem, ListItemText, Button } from "@material-ui/core";
import DeleteIcon from '@material-ui/icons/Delete';

const Todos = ({ todos, deleteTodo }) => {
  const todoList = todos.length ? (
    todos.map((todo) => {
      return (
        <List key={todo.id} style={{Direction:'flex-row'}}>
          <Card style={{width:70, justifyContent:'center', flexDirection:'row'}}>
            <ListItem Button component="a" href="#simple-list">
              <ListItemText primary={todo.content} secondary={todo.date}/>
            </ListItem>
          </Card>
          <Card style={{width:70, justifyContent:'center', flexDirection:'row'}}>
            <Button>
              <DeleteIcon/>
            </Button>
          </Card>
        </List>
      );
    })
  ) : (
    <p>You have no todo's left </p>
  );
  return (
    <div className="todoCollection" style={{ padding: "10px" }}>
      {todoList}
    </div>
  );
};

export default Todos;
